import React from "react";
import Card from "./Card";
import contacts from '../contacts';
import '../styles.css'


function createCard(contact){
  return(
    <Card 
    key={contact.id}
      name = {contact.name}
      imgURL = {contact.imgURL}
      phone = {contact.phone}
      email = {contact.email}
    />
  )
}




function App() {
  return (
   <div>
     {contacts.map(createCard)}
   </div>
  );
}

export default App;
